import React from 'react';

const AdminForm = () => {
return(
  <div className="card">
    <form className="admin-form">
      <input type="text" name="nom" placeholder="nom de la recette" />
      <input type="text" name="image" placeholder="addresse de l'image" />
      <textarea name="ingredients" rows="3" placeholder="liste des ingredients" />
      <textarea name="instructions" rows="15" placeholder="les des instructions" />
    </form>
  </div>
)

}

export default AdminForm;
